    false,nt"url": null,nt"notes": "This annual narrative report for Selawik
    National Wildlife Refuge outlines Refuge accomplishments during the 1986 calendar
    year.  The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    the master plan, the management plan, and research and investigations. Refuge administration
    is outlined; information about personnel, youth programs, manpower programs, funding,
    safety, and technical assistance is given. Habitat management is also covered; subjects
    include wetlands, croplands, grazing, and fire management. The wildlife section
    of the report discusses wildlife diversity, endangered and threatened species, waterfowl,
    marsh birds and waterbirds, shorebirds, raptors, game mammals, marine mammals, fisheries
    resources, scientific collections, and marking and banding. The public uses of the
    Refuge described in this report include interpretive programs, hunting, fishing,
    trapping, wildlife observation, outdoor recreation, and law enforcement. The equipment
    and facilities section of the report provides information about new construction,
    major maintenance, equipment replacement, communication systems, and energy conservation.
    Cooperative programs and items of interest are provided at the end.",nt"license_title":
